const sq={click:(t,e)=>document.getElementById(t).addEventListener("click",t=>{t.preventDefault(),e()}),addClass:(t,e)=>{return function(){for(count=0;count<e.length;count++)document.getElementById(t).classList.add(e[count])}()},removeClass:(t,e)=>{return function(){for(count=0;count<e.length;count++)document.getElementById(t).classList.remove(e[count])}()},contains:(t,e,n)=>{if(null==n)return document.getElementById(t).classList.contains(e);document.getElementById(t).classList.contains(e)&&n()},value:(t,e)=>null!=e?document.getElementById(t).value=e:document.getElementById(t).value};